import React, { Component } from 'react';
import Header from '../components/Header';
import '../css/app.css'


export default class Layout extends Component {

    constructor(props) {
        super(props)
    }
    

    render() {
        return (
            <div className="app-layout">
                <div className="app-container"> 
                    
                        <Header />
                    <div className="app-content">
                        here is the content 
                    </div>
                </div>
            </div>
        )
    }
}
